sidebarCSS:
#root.root {
  --nav-btn-width: 38px;
  --nav-btn-height: 38px;
  --tabs-height: 34px;
  --frame-bg: #1E2021;
  --ctx-menu-bg: #1E2021;
  --tabs-activated-bg: #434546;
}

.Tab[data-parent="true"] .title {
  font-weight: bold;
}

.Tab .t-box {
  --audio-btn-offset: 0px;
}

.TabsPanel .fav-icon {
  left: 2px;
}

.t-box {
  margin-left: 3px !important;
}

.audio {
  left: 15px !important;
  top: -10px !important;
}

.Tab[data-parent="false"][data-colorized="true"]:not([data-lvl="0"]) .color-layer {
  opacity: .15;
}

/*
 * Visually flatten tree structure when sidebar is collapsed
 */
@media screen and (max-width: 50px) {
  #root {
    --tabs-indent: 0px;
  }

  .TabsPanel .fav-icon {
    left: 2px;
  }

  .TabsPanel
    .TabsPanel .close,
    .TabsPanel .exp {
    display: none !important;
  }

    /* Hide static buttons to prevent obstructing the panel icons */
  .static-btns {
    visibility: collapse;
  }

    /* Forces the current active panel icon to be visible */
  .main-items > .nav-item[data-active="true"] {
    opacity: 100 !important;
    transform: initial !important;
  }
}

/*
 * Add glow effect to container indicator
 */
.ctx {
    /* offset-x | offset-y | blur-radius | spread-radius | color */
  box-shadow: 0 1px 10px 1px var(--color);
}
